    constructor(
        address timelock_,
        address uni_,
        address _l2Contract,
        address _l1Bridge
    ) public {
        timelock = TimelockInterface(timelock_);
        uni = UniInterface(uni_);
        l2Contract = _l2Contract;
        l1Bridge = _l1Bridge;
    }

